@import 'mediaQueires';
* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

html {
    background-color: #fff;
    color: #555;
    font-family: 'Dosis', sans-serif;
    font-size: 20px;
    text-rendering: optimizeLegibility;
}

// VARIABLES
@mixin flex-container($dir) {
    display: flex;
    flex-direction: $dir;
    box-shadow: 2px 15px 20px 0px #bbbbbb59;
}

@mixin column($width, $shadow1) {
    width: $width;
    float: left;
    font-family: 'Kanit', sans-serif;
}

@mixin button($width) {
    display: inline-block;
    margin-bottom: 0;
    font-weight: 400;
    text-align: center;
    white-space: nowrap;
    vertical-align: middle;
    -ms-touch-action: manipulation;
    touch-action: manipulation;
    cursor: pointer;
    background-image: none;
    border: 1px solid transparent;
    padding: 6px 12px;
    font-size: 14px;
    border-radius: 0;
    line-height: 1.42857143;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    background-color: #b1086d;
    color: #fff;
    width: $width;
}

@mixin sidebar-menu($heighth, $width) {
    height: $heighth;
    width: $width;
    top: 0;
    left: 0;
    background-color: #b4b1b173;
    overflow-x: hidden;
}

.carousel {
    margin: 7% 7% 0 7%;
}

.flex-container {
    @include flex-container(row);
}

// Image Carousel Elements
.slideshow-container {
    max-width: 1000px;
    position: relative;
    margin: auto;
}

slideimages {
    img {
        vertical-align: middle;
    }
}

.text {
    color: #252222;
    font-size: 15px;
    padding: 8px 12px;
    position: absolute;
    bottom: 8px;
    width: 100%;
    text-align: center;
}

// Previous and next buttons for the carousel
.prev,
.next {
    cursor: pointer;
    position: absolute;
    top: 50%;
    width: auto;
    padding: 16px;
    margin-top: -22px;
    color: white;
    font-weight: bold;
    font-size: 18px;
    transition: 0.6s ease;
    border-radius: 0 3px 3px 0;
    user-select: none;
}


/* Position the "next button" to the right */

.next {
    right: 0;
    border-radius: 3px 0 0 3px;
}


/* On hover, add a black background color with a little bit see-through */

.prev:hover,
.next:hover {
    background-color: rgba(0, 0, 0, 0.8);
}

//  The dots/bullets/indicators 
.dot {
    cursor: pointer;
    height: 4px;
    width: 4px;
    margin: 0 4px;
    background-color: #000;
    border-radius: 50%;
    display: inline-block;
    transition: background-color 0.6s ease;
}

.active,
.dot:hover {
    background-color: #fff;
}


/* Clear floats after the columns */

h5 {
    font-family: 'Kanit', sans-serif;
}

.row:after {
    content: "";
    display: table;
    clear: both;
}

.column-one {
    @include column (60%, -20px -2px 0px 0px #fff);
}

.column-two {
    @include column (40%, 20px 11px 20px 0px #fff);
}

// Buttons
.btn-products {
    @include button(90px);
}

//     display: none;
// }
img {
    vertical-align: middle;
}

footer {
    font-family: 'Karla', serif;
    font-weight: 400;
    font-size: 120%;
    background-color: #ebebeb;
}

footer p {
    font-family: 'Karla', serif;
    font-weight: 300;
    font-size: 70%;
    padding: 7px;
    padding-left: 7%;
}


/* Sidebar */

.menubar {
    display: flex;
    /* display: flex; */
    align-content: flex-start;
    justify-content: flex-start;
    align-items: flex-start;
    flex-direction: row;
}

.sidebar-menu {
    @include sidebar-menu(100%, 25%);
}

.sidebar-menu .tablet {
    @include sidebar-menu(100%, 25%);
}

.sidebar-menu a {
    padding: 6px 6px 6px 32px;
    text-decoration: none;
    font-size: 80%;
    font-weight: 500;
    color: #6a6565;
    display: block;
    border-bottom: 1px solid #867e7e82;
    font-family: 'Dosis', sans-serif;
    margin-left: 9px;
    line-height: 1.7;
}

.sidebar-menu a:hover {
    color: #ffffff;
}

.main {
    margin-left: 0;
    /* Same as the width of the sidenav */
}


/* Product */

.card {
    box-shadow: 5px 4px 8px 0 rgb(0 0 0 / 8%);
    max-width: 365px;
    margin-top: 10%;
    margin: auto;
    text-align: center;
    font-family: arial;
    margin-left: 13px;
    border-bottom: 2px dashed #b4b1b161;
}

.price {
    color: grey;
    font-size: 22px;
}

.card button {
    border: none;
    outline: 0;
    padding: 9px;
    color: #fff;
    background-color: #b1086d;
    text-align: center;
    cursor: pointer;
    width: 100%;
    font-size: 13px;
    margin-top: 10px;
}

.description {
    background-color: #b4b1b173;
    height: 182px;
    text-align: center;
}


/* PLP Mobile */

.dropdown-btn {
    display: inline-block;
    margin-bottom: 0;
    font-weight: 400;
    text-align: center;
    white-space: nowrap;
    vertical-align: middle;
    -ms-touch-action: manipulation;
    touch-action: manipulation;
    cursor: pointer;
    background-image: none;
    border: 1px solid transparent;
    padding: 6px 12px;
    font-size: 14px;
    border-radius: 0;
    line-height: 1.42857143;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    background-color: #b1086d;
    color: #fff;
    width: 100%;
}
